using AvxBlas;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.Linq;

namespace AvxBlasTest.Connection3DTest {
    [TestClass]
    public class BackwardDataPadNoneTest {
        [TestMethod]
        public void SBackwardDataPadNoneTest() {
            float max_err = 0;

            foreach (uint n in new int[] { 1, 2 }) {
                foreach ((uint iw, uint ih, uint id) in new (uint, uint, uint)[] {
                    (1, 1, 1), (1, 1, 4), (1, 4, 1), (4, 1, 1), (5, 2, 8), (12, 16, 15) }) {

                    foreach ((uint kw, uint kh, uint kd) in new (uint, uint, uint)[] {
                        (1, 1, 1), (1, 1, 3), (1, 3, 1), (3, 1, 1), (3, 3, 3), (3, 1, 5), (3, 5, 3), (5, 5, 5) }) {

                        if (iw < kw || ih < kh || id < kd) {
                            continue;
                        }
                        uint ow = iw - kw + 1, oh = ih - kh + 1, od = id - kd + 1;

                        foreach ((uint ic, uint oc) in new (uint, uint)[] { (1, 1), (2, 3), (3, 2), (4, 5), (5, 4), (8, 10), (10, 8),
                                                                            (7, 16), (16, 7), (9, 24), (24, 9), (31, 32), (32, 31), (43, 48), (48, 43), (15, 64), (64, 15) }) {

                            float[] yval = (new float[ow * oh * od * oc * n]).Select((_, idx) => idx * 1e-3f).ToArray();
                            float[] wval = (new float[kw * kh * kd * ic * oc]).Select((_, idx) => (idx + 1) * 1e-3f).Reverse().ToArray();

                            Map3D y = new((int)oc, (int)ow, (int)oh, (int)od, (int)n, yval);
                            Filter3D w = new((int)ic, (int)kw, (int)kh, (int)kd, (int)oc, wval);

                            Map3D x = Reference(y, w, (int)iw, (int)kw, (int)ih, (int)kh, (int)id, (int)kd);

                            Array<float> y_tensor = yval;
                            Array<float> w_tensor = wval;
                            Array<float> x_tensor = new(ic * iw * ih * id * n, zeroset: false);

                            Convolution3D.BackwardData(n, ic, oc, iw, ih, id, kw, kh, kd, PadMode.None, y_tensor, w_tensor, x_tensor);

                            float[] x_expect = x.ToFloatArray();
                            float[] x_actual = x_tensor;

                            CollectionAssert.AreEqual(yval, (float[])y_tensor);
                            CollectionAssert.AreEqual(wval, (float[])w_tensor);

                            AssertError.Tolerance(x_expect, x_actual, 1e-10f, 1e-5f, ref max_err, $"NG: {ic},{oc},{iw},{ih},{id},{kw},{kh},{kd},{n}");

                            Console.WriteLine($"OK: {ic},{oc},{iw},{ih},{id},{kw},{kh},{kd},{n}");
                        }
                    }
                }
            }

            Console.WriteLine($"maxerr:{max_err}");
        }

        public static Map3D Reference(Map3D y, Filter3D w, int iw, int kw, int ih, int kh, int id, int kd) {
            int inchannels = w.InChannels, outchannels = w.OutChannels, batch = y.Batch;
            int ow = iw - kw + 1, oh = ih - kh + 1, od = id - kd + 1;

            if (y.Width != ow || y.Height != oh || y.Depth != od) {
                throw new ArgumentException("mismatch shape");
            }

            Map3D x = new(inchannels, iw, ih, id, batch);

            for (int th = 0; th < batch; th++) {
                for (int kz = 0; kz < kd; kz++) {
                    for (int ky = 0; ky < kh; ky++) {
                        for (int kx = 0; kx < kw; kx++) {
                            for (int oz = 0; oz < od; oz++) {
                                for (int oy = 0; oy < oh; oy++) {
                                    for (int ox = 0; ox < ow; ox++) {
                                        for (int outch = 0; outch < outchannels; outch++) {
                                            double v = y[outch, ox, oy, oz, th];

                                            for (int inch = 0; inch < inchannels; inch++) {
                                                x[inch, kx + ox, ky + oy, kz + oz, th] += v * w[inch, kx, ky, kz, outch];
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }

            return x;
        }

